import { Component, Output } from '@angular/core';

@Component({
  selector: 'sidebar-header',
  templateUrl: './sidebar-header.component.html',
})
export class SidebarHeaderComponent {
  @Output() mobileOrientation: 'start' | 'end';
  styles: {
    mobileOrientation: {
      start: string;
      end: string;
    };
  };

  constructor() {
    this.mobileOrientation = 'end';
    this.styles = {
      mobileOrientation: {
        start: 'left-0',
        end: 'right-0',
      },
    };
  }
}
<div
  class="sticky top-0 mb-16 flex h-20 items-center justify-center bg-[#0E141B] text-3xl text-white"
>
  Smart Admin
</div>
